import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sort/filter controls to appear (contains the view toggle)
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Find the List View button via its title attribute
    const listViewBtn = await page.$('button.view-btn[title="List View"]');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Take screenshot before switching view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_list_view.png'));

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (list view mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Wait for at least one product in list view to render
    await page.waitForSelector('.product-card-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_list_view.png'));

    // Extract some data to verify list view is active
    const isListViewActive = await page.evaluate(() => {
      const btn = document.querySelector('button.view-btn[title="List View"]');
      return btn && btn.classList.contains('active');
    });

    // Count number of product cards in list view
    const productListCount = await page.$$eval('.product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        isListViewActive,
        productListCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
